// src/components/Navigation.jsx
import { useAuth } from '../../context/authContext';

const Navigation = () => {
  const { isAuthenticated, logout } = useAuth();

  return (
    <div className="navigation">
      <div className="navigation-menu">
        <img className="navigation-menu-icon" src="../../asset/images/SoundBrew.svg" alt="menu" />
      </div>
      <div className="sitename">
        <img src="/images/SoundBrew.svg" alt="SoundBrew" />
      </div>
      <div className="auth-container">
        {!isAuthenticated ? (
          <>
            <div className="guest-view">회원가입</div>
            <div className="guest-view loginPage">로그인</div>
          </>
        ) : (
          <div className="logoutPage" onClick={logout}>로그아웃</div>
        )}
      </div>
    </div>
  );
};

export default Navigation;
